import fetch from 'isomorphic-unfetch'

function Page({ stars }) {
  return <div>Next stars: {stars}</div>
}

Page.getInitialProps = async ctx => {
  const fs = require('fs');
  const res = await fs.readFile("../data/testing.txt").toString().split("|");
  return { stars: res[0] }
}

export default Page
